INSERT INTO content_patch_logs (id, create_time, update_time, content_diff, original_content_diff, post_id, publish_time, source_id, status, version) VALUES (3, '2022-02-19 21:44:22', '2022-02-19 21:44:26', '<p><strong>登高</strong></p>
<p>风急天高猿啸哀，渚清沙白鸟飞回。</p>
<p>无边落木萧萧下，不尽长江滚滚来。</p>
<p>万里悲秋常作客，百年多病独登台。</p>
<p>艰难苦恨繁霜鬓，潦倒新停浊酒杯。</p>
', '**登高**

风急天高猿啸哀，渚清沙白鸟飞回。

无边落木萧萧下，不尽长江滚滚来。

万里悲秋常作客，百年多病独登台。

艰难苦恨繁霜鬓，潦倒新停浊酒杯。', 3, '2022-02-19 21:44:26', 0, 0, 1);
